import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

// import RouteTest from './components/RouteTest';

import Home from './Home';
import Login from './Login';

function App() {
  return (
    <BrowserRouter>
    <div className="App">      
      <Routes>
        <Route path="/" element={<Home />} />        
        <Route path="/Login" element={<Login />} />        
      </Routes> 
      {/* <RouteTest /> */}
    </div>
    </BrowserRouter>
  );
}

export default App;
